import React from 'react';
import { Link } from 'react-router-dom';



export default () => {
    return (
        <div className="col-xs-2">           
            <Link to='/'>
            <section className='sidebar'>
                <img src="https://upload.wikimedia.org/wikipedia/commons/thumb/c/cc/IMDb_Logo_Square.svg/1200px-IMDb_Logo_Square.svg.png" width="110" height="130" className="logo" />
            </section>
            </Link>
        </div>
    )
};
